import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";




export default function App() {
  return (
    <Router>
    <div>
      <nav>
        <ul>
          <li>
            <Link to="Home">Home</Link>
          </li>
          <li>
            <Link to="User">User</Link>
          </li>
        </ul>
      </nav>
    </div>
      <Switch>
        <Route path="/home">
          <Home />
        </Route>
        <Route path="/user">
          <Home />
        </Route>
      </Switch>
    </Router>
  );
}

function Home() {
  return <h2>Home</h2>
}

function User() {
  return <h2>User</h2>
}
